all_prims = prims_1_317

s_all_prims = set(all_prims)

def get_prims(n: int) -> Set[int]:
    resp = set()
    sq = sqrt(n)
    for p in all_prims:
        if n % p == 0:
            resp.add(p)
            n //= p
            while n % p == 0:
                n //= p
        if p>=sq:
            break
    if n != 1:
        resp.add(n)
    return resp

class Solution:
    def canTraverseAllPairs(self, nums: List[int]) -> bool:
        mi = min(nums)
        ma = max(nums)
        if mi == 1 and ma == 1:
            return len(nums) == 1
        if mi == 1:
            return False

        rest: List[Set[int]] = list(set(nums))

        rest = [get_prims(x) for x in rest]
        s = set().union(*rest)
        m = { x:i for i,x in enumerate(s) }

        un = UnionFind_by_rank(len(m))
        for r in rest:
            un.union_s([m[i] for i in r])
        
        roots = { un.find(x) for x in m.values() }
        return len(roots) == 1
    
    def canTraverseAllPairs_i(self, nums: List[int]) -> bool:
        """internet solution:
        https://leetcode.com/problems/greatest-common-divisor-traversal/solutions/3568561/c-python-prime-factorization-then-union-find/
        """
        fst = [-1] * (1 + max(nums))
        u = UnionFind_by_rank(len(nums))
        for i, x in enumerate(nums):
            for p in range(2, x):
                if p * p > x: 
                    break
                if x % p != 0: 
                    continue
                if fst[p] != -1: 
                    u.union(fst[p], i)
                else: 
                    fst[p] = i
                while x % p == 0: 
                    x //= p
            if x > 1:
                if fst[x] != -1: 
                    u.union(fst[x], i)
                else: 
                    fst[x] = i
        return u.components == 1
    
    def canTraverseAllPairs_4(self, nums: List[int]) -> bool:
        mi = min(nums)
        ma = max(nums)
        if mi == 1 and ma == 1:
            return len(nums) == 1
        if mi == 1:
            return False

        rest: List[Set[int]] = list(set(nums))

        rest = [get_prims(x) for x in rest]
        s = set()
        for x in rest:
            s.update(x)
        c = 0
        m = dict()
        for n in s:
            m[n] = c
            c += 1

        un = UnionFind_by_rank(len(m))
        for r in rest:
            for a, b in itertools.combinations(r, 2):
                un.union(m[a], m[b])

        return un.components == 1

    def canTraverseAllPairs_3(self, nums: List[int]) -> bool:
        if min(nums) == 1 and max(nums) == 1:
            return len(nums) == 1

        rest: List[Set[int]] = list(set(nums))

        rest = [get_prims(x) for x in rest]
        prims = rest.pop()

        while len(rest) > 0:
            ok = False

            tmp = []
            for i in rest:
                if i.isdisjoint(prims):
                    tmp.append(i)
                else:
                    prims.update(i)
                    ok = True
            rest = tmp

            if not ok:
                break

        return len(rest) == 0

    def canTraverseAllPairs_2(self, nums: List[int]) -> bool:
        """too slow"""
        if min(nums) == 1 and max(nums) == 1:
            return len(nums) == 1

        rest = list(set(nums))

        ok = list()
        ok.append(rest.pop())

        pos = 0

        while pos < len(ok) and len(rest) > 0:
            e = ok[pos]

            tmp = []
            for i in rest:
                if gcd(e, i) == 1:
                    tmp.append(i)
                else:
                    ok.append(i)
            rest = tmp
            pos += 1

        return len(rest) == 0

    def canTraverseAllPairs_1(self, nums: List[int]) -> bool:
        """too slow"""
        n = len(nums)
        un = UnionFind_by_rank(n)

        for start in range(n):
            for end in range(start+1, n):
                if gcd(nums[start], nums[end]) != 1:
                    un.union(start, end)
        return un.components == 1


def do_test(i: int, s, r):
    c = Solution()
    resp = c.canTraverseAllPairs(s)
    if resp == r:
        print("OK", i)
    else:
        print("NOK", i, "expected", r, "response", resp)


